import NewPost from "./form/NewPost";
import Post from "./Post";
import { useState } from "react";
import Axios from "axios";
import "./Grupos.modules.css";
import Navbar from "./layout/Navbar";
import Footer from "./layout/Footer";
import React from 'react'
import ftgrupo from './kokomi_by_IE.jpg';

function Grupos(){
  // javascripto
    const [postList, setPostList] = useState([]);

    const getPosts = () => {
      Axios.get("http://localhost:3001/posts").then((response) => { //pega os dados do backend
        //console.log("Função getPosts: ", postList);
        setPostList(response.data);
    });
    }

    getPosts();

    // html e css
    return ( 
        <><div className="feedGrupos">
        <Navbar />
          <div className="perfilGrupo">
            <div className="col-md-8 mx-auto"> {/* Largura da caixa do perfil do grupo*/}              
              <div className="bg-white shadow rounded overflow-hidden">
                {/*cabecalho do grupo */}
                <div className="px-4 pt-0 pb-5 cover">
                  <div className="media align-items-end profile-head">
                    <div className="profile mr-3">
                      <img src="https://images.contentstack.io/v3/assets/blt731acb42bb3d1659/blt9a2715ced150cb6e/5ef1374f6aaf2924fd231f62/league-client-update-header.jpg" alt="..." width="150px" className="rounded mb-2 img-thumbnail" />
                      <div className="media-body mb-2 text-white">
                        <h4 className="mt-0 mb-0">Nome do Grupo</h4>
                      </div>
                      <a href="#" className="btnEntrar">Entrar para o grupo</a>
                    </div>                    
                  </div>
                </div>
                {/*Seguidores e segindo*/}
                <div className="bg-light p-4 d-flex justify-content-center text-center">
                  <ul className="list-inline mb-0">
                    <li className="list-inline-item px-4">
                      <h5 className="fs-6 mb-0 d-block">215</h5>
                      <small className="text-muted"><i className="fas fa-image mr-1" /> Publicações</small>
                    </li>
                    <li className="list-inline-item px-4">
                      <h5 className="font-weight-bold mb-0 d-block">745</h5>
                      <small className="text-muted"> <i className="fas fa-user mr-1" /> Seguidores</small>
                    </li>
                    <li className="list-inline-item px-4">
                      <h5 className="font-weight-bold mb-0 d-block">340</h5>
                      <small className="text-muted"> <i className="fas fa-user mr-1" /> Seguindo</small>
                    </li>
                  </ul>
                </div>
                {/*Descricao Grupo*/}
                <div className="px-4 py-3">
                  <h5 className="mb-0">Descrição</h5>
                  <div className="p-4 rounded shadow-sm bg-light">
                    <p className="font-italic mb-0"> Sem descrição </p>
                  </div>
                </div>
                {/*Novo Post*/}
                <div className="px-4 py-3">
                  <h5 className="mb-0">Nova publicação</h5>
                  <div className="p-4 rounded shadow-sm bg-light">
                  <NewPost />
                  </div>
                </div>
                {/*Posts*/}
                <div className="py-4 px-4">
                  <div className="d-flex align-items-center justify-content-between mb-3">
                    <h5 className="mb-0">Publicações</h5>
                  </div>
                  <div className="posts">
                  {postList.map((val, key) => {
                    return (
                    <Post user={'@' + val.userName} texto={val.text} />
                    );
                  })}
                  </div>
                </div>
              </div>
            </div>
          </div>
        

        




        
        
      </div><Footer /></>        
        
    )
}

export default Grupos;
